INSERT INTO `ecs_comment` (`comment_id`, `comment_type`, `id_value`, `email`, `user_name`, `content`, `comment_rank`, `add_time`, `ip_address`, `status`, `parent_id`, `user_id`) VALUES
(107, 0, 191, '794188387@qq.com', '', '真心非常好！闺女说很舒服！已经观望很久了，价格合适，果断下手！没有后悔！如果非要说遗憾的话，那就是买晚了！', 5, 1502054843, '180.173.17.233', 1, 0, 0),
(108, 0, 191, '', 'harvey', '亲，感谢您对壹居的认可，祝您生活愉快哦！', 0, 1502054903, '180.173.17.233', 0, 107, 0),
(109, 0, 150, '3033356@qq.com', '', '床很牢固，做工精美，没有什么结，几乎没有味道，仔仔很喜欢。 客服服务认真，答复认真。', 5, 1502055218, '180.173.17.233', 1, 0, 0),
(110, 0, 150, '', 'harvey', '感谢您对壹居的支持，您的满意是我们最大的动力壹居专业品质保证，遇到使用问题请联系我们的专业客服，祝生活愉快！', 0, 1502055309, '180.173.17.233', 0, 109, 0),
(111, 0, 155, '689523@qq.com', '', '很不错的一张床，做工很精细，外表光滑细腻，颜色也很顺，水平面以上真的找不到一条棱角，都经过磨圆处理，和实体店一样', 5, 1502055463, '180.173.17.233', 1, 0, 0),
(112, 0, 155, '', 'harvey', '希望您能继续关注我们壹居，让您的孩子在我们壹居陪伴里健康快乐地成长，期待再次为您服务哦。祝您生活愉快！', 0, 1502055574, '180.173.17.233', 0, 111, 0),
(113, 0, 174, '89526652@qq.com', '', '我家宝贝每天就在这桌子上赖着不下来，画画写字手工忙的不亦乐乎，设计很人性化！', 5, 1502057066, '180.173.17.233', 1, 0, 0),
(114, 0, 174, '', 'harvey', '感谢您对壹居的支持，祝愿我们的家具能给您的孩子和家庭带来幸福！期待您和您的朋友们能与壹居再次相逢，祝生活愉快！', 0, 1502057155, '180.173.17.233', 0, 113, 0);
